import * as yup from 'yup';
import {useForm} from "react-hook-form";
import {yupResolver} from "@hookform/resolvers/yup";
import axios from "axios";
import {useState} from "react"
import styles from "./RegisterPage.module.scss"
import PageHeader from "../pageHeader/PageHeader";

const schema = yup.object({
    name: yup.string().required("Name is required"),
    email: yup.string().email().min(10, "Min 10 characters").required("Email is required"),
    password: yup.string().min(8, "Min 8 characters").required("Password is required"),
    confirmPassword: yup.string().oneOf([yup.ref("Password does not match")]).required("Password is required")
})

const RegisterPage = () => {
    const [isHidden, setIsHidden] = useState(false);
    const [rememberMe, setRememberMe] = useState(false);

    const {register, formState: {errors}, reset, handleSubmit} = useForm({
            resolver: yupResolver(schema)
        }
    );

    const onSubmit = async (values) => {
        try {
            const res = await axios.post("http://localhost:5050/api/auth/register", values);
            if (rememberMe) {
                localStorage.setItem("remember", values.email)
            }

            alert("Successfully registered!");
            reset();
        } catch (e) {
            console.log("ERROR:", e.response?.data || e.message);
            alert("Failed to register");
        }
    }


    return (
        <div className={styles.registration}>
            <PageHeader style={{background: "#205529", color: "white"}} label="Register"
                        subtitle="Register "/>
            <form onSubmit={handleSubmit(onSubmit)}>
                <div className="form-group">
                    <div className={styles.inputForm}>
                        <input className={styles.inputText} type="text" placeholder="Your full name" autoComplete="name" {...register("name")}/>
                        <p className={styles.error}>{errors.name?.message}</p>
                    </div>
                    <div className={styles.inputForm}>
                        <input className={styles.inputText} type="email" placeholder="Your email address" autoComplete="email"{...register("email")} />
                            <p className={styles.error}>{errors.email?.message}</p>
                    </div>
                    <div className={styles.inputForm}>
                        <div className={styles.inputFormPassword}>
                            <input className={styles.inputText} type={isHidden ? "password" : "text"} autoComplete="new-password"
                                   placeholder="Your password" {...register("password")}/>
                            <button  onClick={() => setIsHidden(!isHidden)}
                                    type="button">{isHidden ? "üëÅÔ∏è" : "üôà"}</button>
                        </div>
                        <p className={styles.error}>{errors.password?.message}</p>
                    </div>
                    <div className={styles.inputForm}>
                        <div className={styles.inputFormPassword}>
                            <input className={styles.inputText} type="password" placeholder="Your password"
                                   autoComplete="new-password" {...register("confirmPassword")}/>
                            <button onClick={() => setIsHidden(!isHidden)}
                                    type="button">{isHidden ? "üëÅÔ∏è" : "üôà"}</button>
                        </div>

                        <p className={styles.error}>{errors.confirmPassword?.message}</p>
                    </div>
                    <div className={styles.remember}>
                        <input type="checkbox" className={styles.rememberMe} checked={rememberMe} onChange={(e)=> setRememberMe(e.target.checked)}/>
                        <p>Remember me</p>
                    </div>
                    <div>
                        <button className={styles.submit} type="submit">Register</button>
                    </div>
                </div>
            </form>
        </div>
)
}
export default RegisterPage;
